import React, { Component } from 'react'
import Nav from "../components/Nav";
import AboutBody from "../components/AboutBody"
import $ from "jquery"
import "./AboutMe.css"

export default class AboutMe extends Component {

  componentDidMount() {
    $(".navbar-item").addClass("nav-item-scroll").attr("style", "opacity: .5");
    $(".navbar").addClass("scroll-color").attr("style", "opacity: .5");
  }

  render() {



    return (
      <div>
        <Nav navItemColor="white"/>
        <AboutBody />


      </div>
    )
  }
}
